CREATE TABLE EMPLOYEE_DATA (
  Employee_ID INT PRIMARY KEY,
  SKILL_1 VARCHAR(50), SKILL_1_SCORE INT,
  SKILL_2 VARCHAR(50), SKILL_2_SCORE INT,
  SKILL_3 VARCHAR(50), SKILL_3_SCORE INT,
  SKILL_4 VARCHAR(50), SKILL_4_SCORE INT,
  SKILL_5 VARCHAR(50), SKILL_5_SCORE INT,
  SUNDAY_STARTING_TIME TIME,
  SUNDAY_ENDING_TIME TIME,
  MONDAY_STARTING_TIME TIME,
  MONDAY_ENDING_TIME TIME,
  TUESDAY_STARTING_TIME TIME,
  TUESDAY_ENDING_TIME TIME,
  WEDNESDAY_STARTING_TIME TIME,
  WEDNESDAY_ENDING_TIME TIME,
  THURSDAY_STARTING_TIME TIME,
  THURSDAY_ENDING_TIME TIME,
  FRIDAY_STARTING_TIME TIME,
  FRIDAY_ENDING_TIME TIME,
  SATURDAY_STARTING_TIME TIME,
  SATURDAY_ENDING_TIME TIME
);
